'use strict';
class RolloverProfilesUpdater {
    manager;
    static create(manager) {
        let instance;
        instance = new RolloverProfilesUpdater();
        instance.manager = manager;
        return instance;
    }
    updateRolloverProfiles(queueItem) {
        this.manager.processRolloverProfilesCommandQuery(queueItem);
    }
}
module.exports = RolloverProfilesUpdater
